INSERT INTO tbl_news (news_id, news_title, news_desc, news_image, news_content, created_date, updated_at) VALUES ("7","Áo dài cách tân: “Hơi thở mới” cho trang phục truyền thống","Áo dài cách tân: “Hơi thở mới” cho trang phục truyền thống, Mỗi vạt có 2 thân nối sống tượng trưng cho phụ mẫu, còn vạt con đằng trước tượng trưng cho người mặc. Đặc biệt, đây là kiểu áo mà tầng lớp quan lại, quý tộc thường mặc.","84194903_773654616376103_8257184345794543616_n91.jpg","<h2>Lịch sử hình thành áo dài Việt Nam</h2>
INSERT INTO tbl_news (news_id, news_title, news_desc, news_image, news_content, created_date, updated_at) VALUES ("8","Áo dài cách tân: “Hơi thở mới” cho trang phục truyền thống","Áo dài cách tân: “Hơi thở mới” cho trang phục truyền thống, Mỗi vạt có 2 thân nối sống tượng trưng cho phụ mẫu, còn vạt con đằng trước tượng trưng cho người mặc. Đặc biệt, đây là kiểu áo mà tầng lớp quan lại, quý tộc thường mặc.","84612966_773653896376175_640374783405457408_o76.jpg","<p><strong>Áo dài cách tân</strong>&nbsp;– xu hướng mới, mang phong cách hiện đại, trẻ trung, sang trọng mà vẫn có nét duyên dáng của một chiếc áo dài truyền thống Việt Nam. Ngày nay, không chỉ đơn giản là thứ trang phục để mặc lên người mà áo dài còn trở thành một nét gì đó rất riêng trong tâm thức, linh hồn người Việt.</p>
