	<li><strong>Tay áo</strong>: Dài, không có cầu vai, may kéo dài từ cổ áo đến cổ tay.</li>
	<li><strong>Tà áo</strong>: Gồm 2 tà là tà trước và tà sau, xẻ từ ngang hông xuống dưới.</li>
</ul>

